import Button from '@components/ui/Button';

interface Props {
  resetMaterialGroup: () => void;
}
const ResetMaterialGroupBtn = ({ resetMaterialGroup }: Props) => {
  const resetPopup = () => {
    if (confirm('Reset Material Group?')) {
      resetMaterialGroup();
    }
  };

  return <Button onClick={resetPopup}>Reset</Button>;
};

export default ResetMaterialGroupBtn;
